import { Link, useParams } from 'react-router-dom';

const Sidebar = () => {
  const { id } = useParams();

  return (
    <nav>
      <ul>
        <li>
          <Link to='home'>Home</Link>
        </li>
        <li>
          <Link to='recent'>Recent </Link>
        </li>
        <li>
          <Link to='generate'>Generate </Link>
        </li>
        <li>
          <Link to='setting'>Setting </Link>
        </li>
        <li>
          <Link to='support'>Support </Link>
        </li>
      </ul>
    </nav>
  );
};

export default Sidebar;
